// Extract data from Tally webhook structure
const webhookData = $input.first().json;
const formData = webhookData.body.data;
const fields = formData.fields;

console.log('=== WEBHOOK DEBUG ===');
console.log('Total fields received:', fields.length);

// Helper function to get field value by label - IMPROVED
function getFieldValue(searchLabel) {
  console.log('Searching for field:', searchLabel);

  const field = fields.find(f => {
    const label = f.label.toLowerCase().trim();
    const search = searchLabel.toLowerCase().trim();
    return label.includes(search) || label === search;
  });

  if (!field) {
    console.log('Field not found:', searchLabel);
    return null;
  }

  console.log('Found field:', field.label, 'Type:', field.type, 'Value:', field.value);

  // Handle different field types
  switch (field.type) {
    case 'INPUT_TEXT':
    case 'INPUT_EMAIL':
    case 'INPUT_PHONE_NUMBER':
    case 'INPUT_DATE':
    case 'TEXTAREA':
      return field.value ? field.value.toString().trim() : null;

    case 'INPUT_NUMBER':
      return field.value ? parseFloat(field.value) : 0;

    case 'MULTIPLE_CHOICE':
      if (field.options && field.value && field.value.length > 0) {
        const selectedOption = field.options.find(opt => opt.id === field.value[0]);
        return selectedOption ? selectedOption.text : null;
      }
      return null;

    case 'SIGNATURE':
      return field.value && field.value.length > 0 ? field.value[0].url : null;

    case 'CHECKBOXES':
      // Handle both array format and boolean format
      if (Array.isArray(field.value)) {
        return field.value.length > 0;
      }
      return field.value === true;

    default:
      return field.value;
  }
}

// Generate unique application ID
const appId = 'APP-' + Date.now() + '-' + formData.responseId;

// Extract form data with improved field matching
const fullName = getFieldValue('full legal name');
const email = getFieldValue('email');
const phone = getFieldValue('phone');
const dateOfBirth = getFieldValue('date of birth');
const ssn = getFieldValue('social security number');
const currentAddress = getFieldValue('current address');
const employmentStatus = getFieldValue('employment status');
const employerName = getFieldValue('employers name');
const monthlyIncome = getFieldValue('monthly gross income');
const yearsAtJob = getFieldValue('years at current job');
const propertyAddress = getFieldValue('property address');
const propertyValue = getFieldValue('estimated property value');
const mortgageBalance = getFieldValue('current mortgage balance');
const loanAmount = getFieldValue('desired loan amount');
const loanPurpose = getFieldValue('loan purpose');
const electronicSignature = getFieldValue('electronic signature');
const creditAuthorization = getFieldValue('credit check authorization');
const termsAgreement = getFieldValue('terms and conditions');
const dateSigned = getFieldValue('date signed');

console.log('=== EXTRACTED VALUES ===');
console.log('Full Name:', fullName);
console.log('Email:', email);
console.log('Monthly Income:', monthlyIncome);
console.log('Loan Amount:', loanAmount);
console.log('Property Value:', propertyValue);
console.log('Mortgage Balance:', mortgageBalance);

// Clean SSN
const cleanSSN = ssn ? ssn.toString().replace(/[^\d]/g, '') : '';

// Validate critical fields
if (!fullName || !email || !monthlyIncome || !loanAmount || !propertyValue) {
  return [{
    json: {
      error: true,
      message: 'Missing critical data - check form field mappings',
      application_id: appId,
      debug_data: {
        fullName: fullName,
        email: email,
        monthlyIncome: monthlyIncome,
        loanAmount: loanAmount,
        propertyValue: propertyValue
      }
    }
  }];
}

// Calculate ratios
const loanToValue = propertyValue > 0 ? ((loanAmount / propertyValue) * 100) : 0;
const currentEquity = propertyValue - (mortgageBalance || 0);
const equityPercentage = propertyValue > 0 ? ((currentEquity / propertyValue) * 100) : 0;

console.log('=== CALCULATED VALUES ===');
console.log('LTV:', loanToValue);
console.log('Current Equity:', currentEquity);

// Return processed data
return [{
  json: {
    // Application metadata
    application_id: appId,
    submission_date: formData.createdAt,
    tally_response_id: formData.responseId,
    form_name: formData.formName,

    // Personal information
    full_name: fullName,
    email: email,
    phone: phone,
    ssn: cleanSSN,
    date_of_birth: dateOfBirth,
    current_address: currentAddress,

    // Employment information
    employment_status: employmentStatus,
    employer_name: employerName,
    gross_monthly_income: monthlyIncome,
    years_at_current_job: yearsAtJob,

    // Property information
    property_address: propertyAddress,
    property_value: propertyValue,
    current_mortgage_balance: mortgageBalance || 0,
    current_equity: currentEquity,
    equity_percentage: equityPercentage,

    // Loan information
    desired_loan_amount: loanAmount,
    loan_purpose: loanPurpose,
    loan_to_value: parseFloat(loanToValue.toFixed(2)),

    // Legal compliance
    electronic_signature_url: electronicSignature,
    credit_check_authorized: creditAuthorization,
    terms_agreed: termsAgreement,
    date_signed: dateSigned,
    signature_captured: electronicSignature ? 'Yes' : 'No',

    // Processing status
    error: false,
    status: 'Data Validated and Processed',
    processed_timestamp: new Date().toISOString()
  }
}];

// Get data from the immediate previous node only
const inputData = $input.first().json;

console.log('=== SIMPLE DATA EXTRACTION ===');
console.log('Input data:', inputData);

// Generate unique application ID
const applicationId = 'APP-' + Date.now() + '-' + Math.random().toString(36).substr(2, 5);

// Use safe defaults for testing (replace with real form extraction later)
const applicationData = {
  // Application metadata
  application_id: $('Code').first().json.application_id,
  submission_date: $('Code').first().json.submission_date,
  form_name: $('Code').first().json.form_name,

  // Personal information
  full_name: $('Code').first().json.full_name,
  email: $('Code').first().json.email,
  phone: $('Code').first().json.phone,
  ssn: $('Code').first().json.ssn,
  date_of_birth: $('Code').first().json.date_of_birth,
  current_address: $('Code').first().json.current_address,

  // Employment information
  employment_status: $('Code').first().json.employment_status,
  employer_name: $('Code').first().json.employer_name,
  gross_monthly_income: $('Code').first().json.gross_monthly_income,
  years_at_current_job: $('Code').first().json.years_at_current_job,

  // Property information
  property_address: $('Code').first().json.property_address,
  property_value: $('Code').first().json.property_value,
  current_mortgage_balance: $('Code').first().json.current_mortgage_balance,
  current_equity: $('Code').first().json.current_equity,
  equity_percentage: $('Code').first().json.equity_percentage ,

  // Loan information
  desired_loan_amount: $('Code').first().json.desired_loan_amount,
  loan_purpose: $('Code').first().json.loan_purpose,
  loan_to_value: $('Code').first().json.loan_to_value,

  // Legal compliance
  electronic_signature_url: $('Code').first().json.electronic_signature_url,
  credit_check_authorized: $('Code').first().json.credit_check_authorized,
  terms_agreed: $('Code').first().json.terms_agreed,
  date_signed: $('Code').first().json.date_signed,
  signature_captured: $('Code').first().json.signature_captured
};

// Calculate financial ratios
const monthlyIncome = applicationData.gross_monthly_income;
const loanAmount = applicationData.desired_loan_amount;
const propertyValue = applicationData.property_value;

// Generate credit score based on income
const baseScore = 620;
const incomeBonus = Math.min((monthlyIncome / 1000) * 15, 150);
const randomFactor = 50; // Fixed for consistent testing
const creditScore = Math.min(Math.floor(baseScore + incomeBonus + randomFactor), 850);

// Calculate debt-to-income ratio
const estimatedMonthlyDebt = monthlyIncome * 0.20;
const debtToIncome = parseFloat(((estimatedMonthlyDebt / monthlyIncome) * 100).toFixed(2));

// Calculate loan-to-value ratio
const loanToValue = parseFloat(((loanAmount / propertyValue) * 100).toFixed(2));

console.log('=== CALCULATED VALUES ===');
console.log('Credit Score:', creditScore);
console.log('DTI:', debtToIncome);
console.log('LTV:', loanToValue);

// Decision logic
let decision = '';
let reason = '';
let nextSteps = '';
let estimatedRate = 0;

if (creditScore >= 740 && debtToIncome <= 36 && loanToValue <= 75) {
  decision = 'APPROVED';
  reason = 'Excellent credit profile with low risk ratios';
  nextSteps = 'Proceeding to final underwriting and documentation';
  estimatedRate = 6.50;
} else if (creditScore >= 680 && debtToIncome <= 43 && loanToValue <= 80) {
  decision = 'APPROVED';
  reason = 'Good credit profile meets lending criteria';
  nextSteps = 'Standard documentation and processing';
  estimatedRate = 6.75;
} else {
  decision = 'DECLINED';
  reason = 'Does not meet minimum lending criteria';
  nextSteps = 'Consider credit improvement or debt reduction';
  estimatedRate = 0;
}

// Calculate monthly payment
let monthlyPayment = 0;
if (estimatedRate > 0) {
  const monthlyRate = estimatedRate / 100 / 12;
  const numPayments = 30 * 12;
  monthlyPayment = (loanAmount * monthlyRate * Math.pow(1 + monthlyRate, numPayments)) / (Math.pow(1 + monthlyRate, numPayments) - 1);
  monthlyPayment = Math.round(monthlyPayment * 100) / 100;
}

console.log('=== FINAL RESULTS ===');
console.log('Decision:', decision);
console.log('Monthly Payment:', monthlyPayment);

// Return complete data
return [{
  json: {
    // Original application data
    ...applicationData,

    // Risk assessment results
    credit_score: creditScore,
    estimated_monthly_debt: Math.round(estimatedMonthlyDebt),
    debt_to_income: debtToIncome,

    // Decision results
    automated_decision: decision,
    decision_reason: reason,
    next_steps: nextSteps,

    // Loan terms
    estimated_interest_rate: estimatedRate,
    estimated_monthly_payment: monthlyPayment,

    // Status
    status: 'Risk Assessment Complete',
    risk_processed_date: new Date().toISOString(),
    error: false
  }
}];

